import React from 'react';
import './Profile.css'

const Profile = props => {
    return ( 
        <div className="profile">
            <img className="profile-image" src={props.imgURL} alt=""/>
            <div class="profile-title">
                <span>{props.name}</span>
                <a href="">See Page</a>
            </div>
        </div>
     );
}
 
export default Profile;
